-- Panel Size
create temporary table plans as
select 
distinct 
sstp as plan_name
from l2.pd_attribution;
select
p.plan_name,
coalesce(d.panel_size, 0) as old_l5,
coalesce(a.panel_size, 0) as new_l5,
coalesce(b.panel_size, 0) as new_l3
from plans p
left join
(
select 
p.plan_name,
count(distinct empi) as panel_size
from l5_backup.attribution a 
left join l5_backup.payer p on 
p.payer_master_id = a.payer_master_id 
where 
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.payer_name <> 'Not Assigned'
and date_trunc('month', month_of_attribution) = 'DATE' 
group by 1) d on 
p.plan_name = d.plan_name
left join 
(
select 
p.plan_name,
count(distinct empi) as panel_size
from l5.attribution a 
left join l5.payer p on 
p.payer_master_id = a.payer_master_id 
where 
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.payer_name <> 'Not Assigned'
and date_trunc('month', month_of_attribution) = 'DATE' 
group by 1) a on 
p.plan_name = a.plan_name
left join 
(
select 
sstp as plan_name,
count(distinct empi) as panel_size
from l2.pd_attribution pa
where date_trunc('month', atrdt)::date = 'DATE'::date
and inprsq = 'primary'
group by 1) b on 
p.plan_name = b.plan_name
order by 1;
-- Quality Score%
select 
p.plan_name,
coalesce(d.quality_performance, 0) as old_l5,
coalesce(a.quality_performance, 0) as new_l5,
coalesce(b.quality_performance, 0) as new_l3
from plans p
left join
(
select 
p.plan_name,
round
(
sum(numerator_count)::decimal /
sum(denominator_count)*100, 1) as quality_performance
from l5_backup.quality_pcp a
left join l5_backup.measure m on 
m.measure_master_id = a.measure_master_id 
left join l5_backup.payer p on 
p.payer_master_id = a.payer_master_id 
where 
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.payer_name <> 'Not Assigned'
and date_trunc('month', month_of_measurement) = 'DATE'
and m.inverse_measure_flag is not true
group by 1) d on 
p.plan_name = d.plan_name
left join
(
select 
p.plan_name,
round
(
sum(numerator_count)::decimal /
sum(denominator_count)*100, 1) as quality_performance
from l5.quality_pcp a
left join l5.measure m on 
m.measure_master_id = a.measure_master_id 
left join l5.payer p on 
p.payer_master_id = a.payer_master_id 
where 
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.payer_name <> 'Not Assigned'
and date_trunc('month', month_of_measurement) = 'DATE'
and m.inverse_measure_flag is not true
group by 1) a on 
p.plan_name = a.plan_name
left join 
(
select 
a.plnm as plan_name,
round(sum(mv1)::decimal / 
sum(mv2)*100,1) as quality_performance
from l3.quality a
left join l5.lookup_measure_name_mapping b on 
a.mid = trim(b.measure_id)
where date_trunc('month', a.mdt)::date = 'DATE'::date
and b.inverse_measure_flag is not true
group by 1) b on 
p.plan_name = b.plan_name
order by 1;
-- YTD Risk Adjusted PMPM
drop  table  if exists table1_backup;
create temporary table table1_backup
as
select 
p.plan_name,
sum(a.visit_amount) as amount
from l5_backup.visit_pcp a
left join l5_backup.payer p on 
p.payer_master_id = a.payer_master_id
where 
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.payer_name <> 'Not Assigned'
and date_trunc('month', a.month_of_visit) between 
date_trunc('year' , 'DATE'::date)   and   'DATE'
group by 1;
drop  table  if exists table2_backup;
create temporary table table2_backup
as
select
p.plan_name,
count(a.empi) as cnt
from l5_backup.attribution a 
left join l5_backup.payer p on 
p.payer_master_id = a.payer_master_id 
where
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.payer_name <> 'Not Assigned'
and date_trunc('month', a.month_of_attribution) between 
date_trunc('year' , 'DATE'::date)   and   'DATE'
group by 1;
drop  table  if exists table3_backup;
create temporary table table3_backup
as
select 
p.plan_name,
sum(risk_value)::decimal / 
sum(patient_count) as var
from l5_backup.risk_pcp a
left join l5_backup.payer p on
p.payer_master_id = a.payer_master_id 
where 
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.payer_name <> 'Not Assigned'
and date_trunc('month', month_of_measurement) = 'DATE'
group by 1;
drop  table  if exists table1;
create temporary table table1 
as
select 
p.plan_name,
sum(a.visit_amount) as amount
from l5.visit_pcp a
left join l5.payer p on 
p.payer_master_id = a.payer_master_id
where 
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.payer_name <> 'Not Assigned'
and date_trunc('month', a.month_of_visit) between 
date_trunc('year' , 'DATE'::date)   and   'DATE'
group by 1;
drop  table  if exists table2;
create temporary table table2
as
select
p.plan_name,
count(a.empi) as cnt
from l5.attribution a 
left join l5.payer p on 
p.payer_master_id = a.payer_master_id 
where
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.payer_name <> 'Not Assigned'
and date_trunc('month', a.month_of_attribution) between 
date_trunc('year' , 'DATE'::date)   and   'DATE'
group by 1;
drop  table  if exists table3;
create temporary table table3
as
select 
p.plan_name,
sum(risk_value)::decimal / 
sum(patient_count) as var
from l5.risk_pcp a
left join l5.payer p on
p.payer_master_id = a.payer_master_id 
where 
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.payer_name <> 'Not Assigned'
and date_trunc('month', month_of_measurement) = 'DATE'
group by 1;
drop table  if  exists table4;
create temporary table table4 
as
select 
sstp as plan_name,
round(sum(visit_amount)::decimal) as numerator1
from
(
select 
*,
b.empi as b_empi,
row_number() over(partition by a.visit_id , sub_source_type)
as rn
from l3.aggregate_output a
left join l3.claims_output c on 
c.visit_id = a.visit_id 
left join 
(
select 
empi,
sstp,
prvid,
date_trunc('month', p.atrdt) month_of_attribution
from l2.pd_attribution p
where inprsq = 'primary'
group by 1,2,3,4) b on 
b.empi = a.empi
and b.sstp = c.sub_source_type
and b.month_of_attribution = date_trunc('month', a.visit_start_date)
where 
b.prvid is not null
and date_trunc('month', visit_start_date) between date_trunc('year', 'DATE'::date) and 'DATE'
and a.visit_type <> 'Denied Claim') t 
where rn = '1'
group by 1;
drop  table  if exists table5;
create temporary table table5 
as
select 
plan_name,
sum(coalesce(risk_value, 0.0))::decimal / count(distinct empi) as denominator
from l3.risk_output r
where 
date_trunc('month', measure_date) = 'DATE' 
group by 1;
drop  table if  exists table6;
create temporary table table6
as
select 
pa.sstp as plan_name,
count(empi) as numerator2
from l2.pd_attribution pa
where inprsq = 'primary'
and prvid is not null
and date_trunc('month', atrdt) between date_trunc('year', 'DATE'::date) and 'DATE'
group by 1;
select 
p.plan_name,
coalesce(d.adjusted_pmpm, 0) as old_l5,
coalesce(a.adjusted_pmpm, 0) as new_l5,
coalesce(b.adjusted_pmpm, 0) as new_l3
from plans p
left join
(
select
table1_backup.plan_name,
round((table1_backup.amount::Decimal / table2_backup.cnt) / table3_backup.var, 1) as adjusted_pmpm
from table1_backup
join table2_backup on 
table1_backup.plan_name = table2_backup.plan_name
join table3_backup on 
table1_backup.plan_name = table3_backup.plan_name
) d on 
p.plan_name = d.plan_name
left join 
(
select
table1.plan_name,
round((table1.amount::Decimal / table2.cnt) / table3.var, 1) as adjusted_pmpm
from table1
join table2 on 
table1.plan_name = table2.plan_name
join table3 on 
table1.plan_name = table3.plan_name
) a on 
p.plan_name = a.plan_name
left join 
(
select 
table4.plan_name,
round((table4.numerator1::decimal / table6.numerator2) / table5.denominator, 1)as adjusted_pmpm
from table4 
join table5 on 
table4.plan_name = table5.plan_name
join table6 on 
table4.plan_name = table6.plan_name
) b on 
p.plan_name = b.plan_name
order by 1;
-- Risk Recapture Rate%
drop table  if  exists risk_temp;
create temporary table risk_temp
as
select 
empi,
period_mode,
measure_config_id,
risk_model_sub_type,
plan_name,
date_trunc('month', measure_date) as month_of_measurement 
from l3.risk_output;
alter table risk_temp
add column recapture_numerator numeric;
update risk_temp
set recapture_numerator = t1.recapture_numerator
from 
(
select 
count(distinct risk_factor)  recapture_numerator,
empi,
period_mode,
risk_model_sub_type,
cdi_config_id,
date_trunc('month', measure_date) as month_of_measurement 
from l3.cdi_group
where 
captured_risk_factor_flag is true
and chronic_flag is true
and risk_factor_value != 0
and is_deleted is not true
group by 
empi,
period_mode,
risk_model_sub_type,
cdi_config_id,
month_of_measurement
) t1 
where 
t1.empi = risk_temp.empi
and t1.month_of_measurement = risk_temp.month_of_measurement
and t1.risk_model_sub_type  = risk_temp.risk_model_sub_type
and t1.period_mode = risk_temp.period_mode
and t1.cdi_config_id = risk_temp.measure_config_id;
alter table risk_temp
add column recapture_denominator numeric;
update risk_temp
set recapture_denominator = t1.recapture_denominator
from 
(
select 
count(distinct risk_factor) as recapture_denominator,
empi,
period_mode,
risk_model_sub_type,
cdi_config_id,
date_trunc('month', measure_date) as month_of_measurement 
from l3.cdi_group
where 
chronic_flag is true
and risk_factor_value != 0
and is_deleted is not true
group by 
empi,
period_mode,
risk_model_sub_type,
cdi_config_id,
month_of_measurement
) t1 
where 
t1.empi = risk_temp.empi
and t1.month_of_measurement = risk_temp.month_of_measurement
and t1.risk_model_sub_type  = risk_temp.risk_model_sub_type
and t1.period_mode = risk_temp.period_mode
and t1.cdi_config_id = risk_temp.measure_config_id;
select 
p.plan_name,
coalesce(d.recap_rate, 0) as old_l5,
coalesce(a.recap_rate, 0) as new_l5,
coalesce(b.recap_rate, 0) as new_l3
from plans p
left join
(
select 
p.plan_name,
case when sum(recapture_denominator) is null or sum(recapture_denominator) = 0 then 0
else 
round
(
sum(coalesce(recapture_numerator, 0))::float * 100/ 
sum(coalesce(recapture_denominator, 0)), 1) end  recap_rate
from l5_backup.risk_pcp a
left join l5_backup.payer p on 
p.payer_master_id = a.payer_master_id
where 
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.plan_name not in ('Not Assigned', 'CHISV')
and date_trunc('month', month_of_measurement) = 'DATE' 
group by 1) d on 
p.plan_name = d.plan_name
left join
(
select 
p.plan_name,
case when sum(recapture_denominator) is null or sum(recapture_denominator) = 0 then 0
else 
round
(
sum(coalesce(recapture_numerator, 0))::float * 100/ 
sum(coalesce(recapture_denominator, 0)), 1) end  recap_rate
from l5.risk_pcp a
left join l5.payer p on 
p.payer_master_id = a.payer_master_id
where 
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.plan_name not in ('Not Assigned', 'CHISV')
and date_trunc('month', month_of_measurement) = 'DATE' 
group by 1) a on
p.plan_name = a.plan_name
left join
(
select 
a.plan_name,
case when sum(recapture_denominator) is null or sum(recapture_denominator) = 0 then 0
else 
round
(
sum(coalesce(recapture_numerator, 0))::float * 100/ 
sum(coalesce(recapture_denominator, 0)), 1) end  recap_rate
from risk_temp a
where 
date_trunc('month', a.month_of_measurement)  =  'DATE'
group by 1) b on
p.plan_name = b.plan_name
order by 1;
-- YTD 30 day Readmission%
drop table if  exists  l5_numbers_backup;
create temporary table l5_numbers_backup
as
select 
a.plan_name,
case when b.visit_count is null or b.visit_count = 0 then 0
else 
round
(
a.visit_count::float * 100 /
b.visit_count, 1) end  as  readmission
from 
(
select 
p.plan_name,
sum(visit_count) as visit_count
from l5_backup.readmit_pcp a
left join l5_backup.payer p on 
p.payer_master_id = a.payer_master_id 
where 
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.payer_name <> 'Not Assigned'
and date_trunc('month', a.month_of_visit) between date_trunc('year', 'DATE'::date) and 'DATE'
and a.readmission_flag is true 
group by 1) a
join 
(
select 
p.plan_name,
sum(visit_count) visit_count
from l5_backup.readmit_pcp a
left join l5_backup.payer p on 
p.payer_master_id = a.payer_master_id 
where 
a.org_hierarchy_master_id is not null
and a.org_hierarchy_master_id <>'N/A'
and p.payer_name <> 'Not Assigned'
and date_trunc('month', a.month_of_visit) between date_trunc('year', 'DATE'::date) and 'DATE'
and a.readmission_index_visit_flag is true 
group by 1) b on 
a.plan_name = b.plan_name
order by 1;
