drop table  if  exists mv_readmission_excluded;
create temporary table mv_readmission_excluded
as
select 
t1.*
from 
(
(
select
visit_id, 
empi,
sub_source_type,
case when trim(drg_code) ~ '^[0-9]' then trim(drg_code)
else null end::float::integer drg_code_index,
first_date_of_service,
last_date_of_service,
ROW_NUMBER() OVER (PARTITION BY 
visit_id,
sub_source_type 
ORDER BY 
source_file_name asc,
case 
when service_provider_npi is null or service_provider_npi= '' then 0 
else 1 end Desc,
cost_centre1_amount DESC NULLS last,
cost_centre2 ASC,
unique_group_id) AS row_number
from l3.claims_output
where claim_type = 'Acute Inpatient'
and coalesce(discharge_disposition_code,'None') not in ('07')
) t1
left join mv_readmission_exclude_visits t2 on 
t1.visit_id = t2.visit_id
and t1.row_number = 1
) where t2.visit_id is null;
drop table  if  exists t24;
create temporary table t24 
as
select 
empi,
visit_id,
visit_start_date,
sub_source_type,
visit_end_date,
case when interval_ is null then null else 'Readmission' end as visit_sub_type,
cast(drg_code_readmission as integer) as drg_code_readmission,
readmission_visit_id
from 
(
select 
*,
row_number() over (partition by visit_id order by interval_ asc,visit_end_date desc,drg_code_readmission desc) rank
from 
(
select 
distinct 
index.empi,
readmission.visit_start_date,
readmission.visit_end_date,
index.visit_id,
null visit_sub_type   ,
(readmission.visit_start_date::date - index.visit_end_date::date) interval_,
readmission.drg_code drg_code_readmission,
readmission.visit_id readmission_visit_id,
index.sub_source_type
from
(
select 
t1.empi,
visit_start_date,
visit_end_date,
t1.visit_id ,
drg_code_index drg_code,
t2.sub_source_type
from l3.aggregate_output t1
inner join mv_readmission_excluded t2 on 
t1.visit_id = t2.visit_id
where t1.visit_id in (select distinct visit_id from mv_readmission_excluded)) index
left join
(
select 
t1.empi,
visit_start_date,
visit_end_date,
t1.visit_id ,
drg_code_index drg_code,
t2.sub_source_type
from l3.aggregate_output t1
inner join mv_readmission_excluded t2 on 
t1.visit_id = t2.visit_id
where t1.visit_id in (select distinct visit_id from mv_readmission_excluded)) readmission on 
(
index.empi = readmission.empi
and (readmission.visit_start_date::date - index.visit_end_date::date) <= 30
and (readmission.visit_start_date::date - index.visit_end_date::date) > 0
and index.visit_id != readmission.visit_id)
) a
) ip_to_ip where rank = 1
union all
select 
empi,
visit_id,
visit_start_date,
sub_source_type,
visit_end_date,
case when "interval" is null then null else 'SNF Inpatient claim' end as visit_sub_type,
cast(drg_code_readmission as integer) as drg_code_readmission,
readmission_visit_id
from 
(
select 
*,
row_number() over (partition by visit_id order by "interval" desc) rank
from 
(
select 
distinct 
index.empi,
readmission.visit_start_date,
readmission.visit_end_date,
index.visit_id,
null visit_sub_type   ,
(readmission.visit_start_date::date - index.visit_end_date::date) "interval",
readmission.drg_code drg_code_readmission,
readmission.visit_id readmission_visit_id,
readmission.sub_source_type
from
(
select 
t1.empi,
visit_start_date,
visit_end_date,
t1.visit_id
from l3.aggregate_output t1
where visit_sub_type = 'SNF Inpatient Claim') index
left join
(
select 
t1.empi,
visit_start_date,
visit_end_date,
t1.visit_id ,
drg_code_index drg_code,
t2.sub_source_type
from l3.aggregate_output t1
inner join mv_readmission_excluded t2 on 
t1.visit_id = t2.visit_id
where t1.visit_id in (select distinct visit_id from mv_readmission_excluded)) readmission on 
(
index.empi = readmission.empi
and (readmission.visit_start_date::date - index.visit_end_date::date) <= 30
and (readmission.visit_start_date::date - index.visit_end_date::date) > 0
and index.visit_id != readmission.visit_id)
) a
) snf_to_ip where rank = 1;
alter table t24 
add column index_visit_start_date date;
alter table t24
add column  index_visit_end_date  date;
update t24 
set 
index_visit_start_date = t1.visit_start_date,
index_visit_end_date   = t1.visit_end_date
from 
(
select 
distinct 
t24.visit_id ,
t1.visit_start_date,
t1.visit_end_date
from t24 left join 
l3.aggregate_output t1 on 
t24.visit_id = t1.visit_id
) t1
where 
t1.visit_id = t24.visit_id;
delete from t24
using l2.empi t1
where t24.empi = t1.empi
and t1.deceased_date between t24.index_visit_start_date::date and t24.index_visit_end_date::date
and t24.visit_sub_type is null;
select 
p.plan_name,
coalesce(d.readmission, 0) as old_l5,
coalesce(a.readmission, 0) as new_l5,
coalesce(b.readmission, 0) as new_l3
from plans p
left join l5_numbers_backup d on
p.plan_name = d.plan_name
left join l5_numbers a on 
p.plan_name = a.plan_name
left join 
(
select 
a.plan_name,
case when b.visit_count is null or b.visit_count = 0 then 0
else 
round
(
a.visit_count::float * 100 /
b.visit_count, 1) end  as  readmission
from 
(
select 
t24.sub_source_type as plan_name,
count(t1.visit_id) as visit_count
from l3.aggregate_output t1
left join t24 on
t1.visit_id = t24.visit_id
where 
date_trunc('month', t1.visit_start_date) between date_trunc('year', 'DATE'::date) and 'DATE'  
and t24.visit_sub_type = 'Readmission'
and t1.visit_type <> 'Denied Claim'
group by 1) a
join 
(
select 
t24.sub_source_type as plan_name,
count(t1.visit_id) as visit_count
from l3.aggregate_output t1
left join t24 on
t1.visit_id = t24.visit_id
where 
date_trunc('month', t1.visit_start_date) between date_trunc('year', 'DATE'::date) and 'DATE'  
and t24.visit_id is not null
and t1.visit_type <> 'Denied Claim'
group by 1) b on 
a.plan_name = b.plan_name) b on 
p.plan_name = b.plan_name
order by 1;
